description:
“The black wind howls… One among you will shortly perish.” —Brian Peppers, 12000 BC.
This is a portrait of the world's first and best time traveler, Brian Peppers, and his arrival in the Kingdom of Zeal in the year 12,000 B.C. Here, Brian meets Crono and co. and lets them know things are about to get spicy.
